import React, { useEffect } from "react";
import { Provider } from "react-redux";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import store from "./store";
import setAuthToken from "./utill/setAuthToken";
import { setCurrentUser } from "./actions/authAction";
import ProtectedRoute from "./components/general/protectedRoute";
import Dashboard from "./components/dashboard/index";
import AddProduct from "./components/dashboard/components/Addproduct";
import Product from "./components/dashboard/components/Product";
import Home from "./components/dashboard/components/Home";
import Register from "./components/auth/Register";
import Login from "./components/auth/Login";
import Landing from "./components/landing";
import "./App.css";

if (localStorage.token) {
  setAuthToken(localStorage.token);
}

function App(props) {
  useEffect(() => {
    store.dispatch(setCurrentUser());
  }, []);

  return (
    <Provider store={store}>
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<Landing />} />
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login />} />
            <Route/>
            <Route
              path="/dashboard"
              element={<ProtectedRoute element={<Dashboard {...props} nestedRoute={Home} />} />}
            />
            <Route
              path="/dashboard/addproduct"
              element={<ProtectedRoute element={<Dashboard {...props} nestedRoute={AddProduct} />} />}
            />
            <Route
              path="/product"
              element={<ProtectedRoute element={<Dashboard {...props} nestedRoute={Product} />} />}
            />
          </Routes>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
